import React, { Component } from 'react';

class DisplayCurrentUserInfo extends Component {
  render() {
    const {login} = this.props.userInfo;
    return (
      <div>
        <h1>{login}</h1>
      </div>
    );
  }
}

export default DisplayCurrentUserInfo;
